import React from "react";
import '../Css/Footer.css';
import Privacy_Policy from './Privacy Policy';
import Terms_Condtions from './Terms & Conditions';

function Footer(){
    return(
        <section>
            <footer class="bg-dark text-light py-3">
                <div class="container text-center">
                    <div class="row">
                        <div class="col-12">
                            <p class="footerText">&copy; 2024|  4 Wheel Barbers. All rights reserved.</p>
                            <a class="footerText" href="./Terms & Conditions.js">Terms & Conditions</a>
                            <a class="footerText" href="./Privacy Policy.js">Privacy Policy</a>
                        </div>
                        <Privacy_Policy/>
                    </div>
                </div>        
            </footer>
        </section>
    )
}

export default Footer;
